export function Loader(THREE){
    let geometry = new THREE.CubeGeometry(300, 300, 300, 300)
    let material = new THREE.MeshBasicMaterial({color: 0x9197AE, wireframe: true})
    let mesh = new THREE.Mesh(geometry, material)

    return(mesh);
}
